function doAvg(t,n){for(let e=7;e<t.length;e++){n.push(Math.round((t[e]+t[e-1]+t[e-2]+t[e-3]+t[e-4]+t[e-5]+t[e-6])/7*10)/10)}return n}function doAvgNoRound(t,n){for(let e=7;e<t.length;e++){n.push(Math.round((t[e]+t[e-1]+t[e-2]+t[e-3]+t[e-4]+t[e-5]+t[e-6])/7*1e4)/1e4)}return n}function baseArrAv(){const t=[];for(let e=0;e<19;e++){t.push([null,null,null,null])}return t}function baseArr(){return[[],[],[],[],[],[],[],[],[],[],[],[],[],[],[],[],[],[],[]]}function setCookie(e,t,n){var o=new Date;o.setTime(o.getTime()+n*24*60*60*1e3);var r="expires="+o.toUTCString();document.cookie=e+"="+t+";"+r+";path=/"}function getCookie(e){var t=e+"=";var n=decodeURIComponent(document.cookie);var o=n.split(";");for(var r=0;r<o.length;r++){var u=o[r];while(u.charAt(0)==" "){u=u.substring(1)}if(u.indexOf(t)==0){return u.substring(t.length,u.length)}}return""}function changeColour(e){if(e===0){setCookie("colourSequence",0,5)}else if(e===2){setCookie("colourSequence",2,5)}else{setCookie("colourSequence",1,5)}location.reload()}function numberWithCommas(e){return e.toString().replace(/\B(?=(\d{3})+(?!\d))/g,",")}function standardChart(e,t,n,o){return{type:e,data:{labels:t,datasets:n},options:o}}function dataSet(e,t,n,o,r){return{label:e,backgroundColor:t,borderColor:n,data:o,type:r}}function chartWithTag(e,t,n,o,r={scales:{xAxes:[{gridLines:{display:true,color:chartStyleColours[darkmode][0]}}],yAxes:[{gridLines:{display:true,color:chartStyleColours[darkmode][0],zeroLineColor:chartStyleColours[darkmode][1],zeroLineWidth:2}}]}}){new Chart(document.getElementById(e).getContext("2d"),standardChart(t,n,o,r))}function valReturn(e,t){document.getElementById(e).innerHTML=t}function valReturnSet(t){for(let e=0;e<t.length;e++){valReturn(t[e][0],t[e][1])}}function getHalfRate(e,t,n){return n*-Math.log(2)/Math.log(e/t)}function datediff(e,t){return Math.round((t-e)/(1e3*60*60*24))}